  - name: TEXT4000
    number: '6'
    value: 'Your letter from January 11, 2007:  In the months of January 2007 to March
      2007 none of our employees spend 25% or more of their  time on FEA or activities
      in connection with a Federal election and their salaries were paid from our
      nonfederal account. 2. The transfer in of $ 16,829.72 from the non-federal account
      for allocated activity was for the time period 11/28/06 to 12/31/06 and was
      based on $ 19,799.67 joint expenses. . The transfer in of $ 57,090.43 from the
      non-federal account for allocated activity was for the time period 1/1/07 to
      2/28/07 and was based on $ 67,165.18 joint expenses.  However, the wrong percentage
      rate for the federal portion of these amounts was used.  We refunded the overpayment
      on 10/31/07 and reported it with our November 2007 report. 3. The payments on
      Schedule H4 for federal and state payroll taxes, health insurance, insurance,
      ITEMIZE: insurance, and net pay were for employees who did not spend 25% or
      more of their time on FEA or activities in connection with a Federal election.
      4. The payments for contract labor/janitor were made to an individual who is
      not our employee.  He is a self employed individual who has a janitorial service
      and other clients and we hired him to clean our offices.  5. We have amended
      the report to show the proper allocation ratio on schedule H 1 and H4. Furthermore,
      we have repaid the overpayment to our nonfederal account on October 2007 and
      reported this in our November 2007 report. .'
